INSERT INTO `about_us` (`id`, `about_us`) VALUES
(1,	'&lt;p&gt;&lt;strong&gt;VISION&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;To be among the Leading Global Tour Operators.&lt;/li&gt;\r\n&lt;li&gt;To focus largely on promotion to the Travels and Tourism sector worldwide.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;MISSION&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Through a plan for Networking, Partnerships and Affiliations; we aim at driving people and their commitments to get satisfactory results for profitable growths.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt; &lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;OUTFIT&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Dip Tour aim to be one of the leading Global Tour Operators, Travel and Hospitality Management company with head corporate head office in Lagos, Nigeria, operating since year 2004 as Dip Leisures; until August 2012 it got converted by the corporate Affairs Commission as Dip Tour.&lt;/p&gt;\r\n&lt;p&gt;It comprises a combination of highly experienced personnel and certified travel &amp;amp; tour practitioners whom had served in various fields especially in the Travels, Tourism and Hospitality sector.&lt;/p&gt;\r\n&lt;p&gt;As a team, DTL personnel possess multiple years of global working experience and sound understanding of domestic and international travel markets and protocols. We do our research, take into consideration just to keep you informed of the critical importance of a destination, that its infrastructure facilities are of high standard such as offering telecommunication services, environmental management, health and sanitation, and perhaps most critical, safety and security; before getting familiar with you on the intrinsic of the &lt;strong&gt;5 A&rsquo;s of tours &lt;/strong&gt;as centred on:&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;&lt;em&gt;Accessibility:&lt;/em&gt;&lt;/strong&gt;&lt;em&gt; No destination can function well unless there is a means of getting there and the processes including visa advisory &amp;amp; your preferred mode of travel is what we coordinate.&lt;/em&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;&lt;em&gt;Accommodations:&lt;/em&gt;&lt;/strong&gt; &lt;em&gt;We cater for accommodation on every destination people should stay and their lodging types to suit their needs.&lt;/em&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;&lt;em&gt;Activities:&lt;/em&gt;&lt;/strong&gt;&lt;em&gt;     When you get to a destination, what do you then do? We would be glad to know while you leave the rest to us.&lt;/em&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;&lt;em&gt;Amenities:&lt;/em&gt;&lt;/strong&gt;&lt;em&gt;    Feel free to inform us on what other products you would love to add during your trips for best advice.&lt;/em&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;&lt;em&gt;Attractions: &lt;/em&gt;&lt;/strong&gt;&lt;em&gt;As your preferred travel partner, we do love that you take advantage of your destination on what is there for you to see in different cultures and environments.&lt;/em&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;em&gt;Hence, we delight ourselves to act according to them in relation to your interest and budgets.&lt;/em&gt;&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;CORE VALUES&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Excellent Delivery&lt;/li&gt;\r\n&lt;li&gt;Value for Money&lt;/li&gt;\r\n&lt;li&gt;Customer&rsquo;s Satisfaction + Rewarding Relationship&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;APPROACH&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;We carry out base line studies in travels and tourism, and also develop appropriate programs to address the needs of each individual and corporate organization.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt; &lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;STRENGTH&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Our strength is in the quality of our team of consultants, facilitators, and networks who are engaged to satisfy the request a client.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;TEAM&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;We engage highly experienced professionals with track record of successes in their fields of specialization.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt; &lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;ACHIEVEMENTS OVER THE YEARS&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Recorded successes with travel products and services delivering to client in virtually all sectors including Government, Telecommunication &amp;amp; IT, Education, Medical, Entertainment, Manufacturing, and the Oil &amp;amp; Gas sector.&lt;/li&gt;\r\n&lt;li&gt;Publishers of DIP Travelers&rsquo; Magazine (DTMagazine) &ndash; a Travels &amp;amp; Tours Publication Guide since 2004.&lt;/li&gt;\r\n&lt;li&gt;A Multi Award-Winning Travel Company.&lt;/li&gt;\r\n&lt;li&gt;Unlimited numbers of both domestic and international tour packages for leisure, business, MICE (meetings, incentive, conferences, exhibitions) FIT/GIT (Free Independent Travelers / Group Inclusive Tours) without boundaries to a destination.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;Under our auspices, we have become members, representative and trade partners to a wide array of local and global institutions, boards and corporate organizations to maximize travel and tourism potentials and opportunities.&lt;/p&gt;\r\n&lt;p&gt;Providing marketable initiatives to the promotion of tourism and its several destinations globally.&lt;/p&gt;');
