INSERT INTO `blog` (`id`, `title`, `summary`, `description`, `creator`, `created_on`, `tags`, `comments_count`) VALUES
(1,	'5 BEST TOURIST DESTINATIONS IN AFRICA',	'Arik Air is West-Africas leading airline operating a domestic, regional and international flight network that operates mainly from two hubs at Murtala Mohammed International Airport, Lagos and Nnamdi Azikiwe International Airport, Abuja.',	'',	1,	'2019-11-26 09:20:25',	'Tour and Travel',	319),
(2,	'DIP TOUR, LISTED AMONG TOP 10 TRAVEL AGENCIES IN NIGERIA BY NAIJ.COM',	'Sometimes it can be difficult to find a reliable and trustworthy travel agency. We have compiled a list of the best travel agencies in Nigeria for your convenience. We believe that any of these agencies will offer you high-quality services at affordable prices.',	'',	1,	'2019-11-26 09:19:02',	'Tour and travel',	15),
(3,	'BRITISH AIRWAYS IS THE LARGEST AIRLINE IN THE UNITED KINGDOM BASED ON FLEET SIZE',	'British Airways is the largest airline in the United Kingdom based on fleet size, or the second largest, behind easyJet, when measured by passengers carried. The airline is based in Waterside near its main hub at London Heathrow Airport. ',	'',	1,	'2019-11-26 09:20:09',	'Tour and Travel',	19),
(4,	'FLY KLM ROYAL DUTCH AIRLINE',	'Book your KLM Royal Dutch Airlines flight today! Founded in 1919, KLM Royal Dutch Airlines is headquartered in Amstelveen, Netherlands near Amsterdam Airport Schiphol. KLM flights serve the Netherlands and surrounding Dutch colonies. Amsterdam Airport Schiphol is 20 minutes from Amsterdam and is the main international airport of the Netherlands. In 2004 KLM merged with Air France, to become Air France KLM, making them one of the largest European airline groups',	'',	1,	'2019-11-26 11:15:09',	'Tour and Travel',	22);
