INSERT INTO `our_network` (`id`, `our_network`) VALUES
(1,	'&lt;p&gt;&lt;strong&gt;NETWORK&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;We believe in Networking, Partnerships and Affiliation in order to provide global quality travels and tourism services and have over the years served our clients on these bases.&lt;/p&gt;\r\n&lt;p&gt;Dip Tour is certified member with the International Air Transport Association &lt;strong&gt;(IATA);&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;National Association of Nigerian Travel Agencies &lt;strong&gt;(NANTA). &lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Member with the &lt;strong&gt;Ministry&lt;/strong&gt;&lt;strong&gt; of Tourism, Arts &amp;amp; Culture&lt;/strong&gt; &ndash; Lagos State.&lt;/p&gt;\r\n&lt;p&gt;And more Domestic and International Organizations, Institutions, Boards, and Associations.&lt;/p&gt;');
