INSERT INTO `privacy_policy` (`id`, `privacy_policy`) VALUES
(1,	'&lt;p&gt;&lt;strong&gt;&lt;em&gt;STATEMENT OF CONFIDENTIALITY AND NON DISCLOSURE.....&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;We treat all information you provide us with as confidential....&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Our Commitment to Privacy&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Your privacy is important to us. To better protect your privacy we provide this privacy policy explaining how we collect, use, disclose or otherwise process personally identifiable information or data that may be provided to Dip Tour Ltd.&lt;/p&gt;\r\n&lt;p&gt;We collect information about our customers both during the order process, enquiry and as customers navigate our online website &ndash; https://www.diptourltd.com and websites that participates at the partners program of Dip Tour Ltd.&lt;/p&gt;\r\n&lt;p&gt;The information provided by customers during the ordering process such as names, physical address, emails, and payment information is considered private, and Dip Tour will not sell this personal information to third parties. This information will be used to process your order (request) and deliver it to you in a timely manner. In addition, we may contact existing customers regarding for future deals, promos and events as it solely relates to their interest.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Third Party Service Providers&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Dip Tour may share your information provided with your order with third-party service providers who provide services relating to your request with the aim to facilitate such request. Examples of these third-party service providers may include a Financial Processing Company or a Travel Supplier/Distributor such as the airline, hotel company and other travel and hospitality outfit. Your personal information will not be used by any third party for purposes other than providing these services in relation to your order and interest.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Legal Disclosure of Your Information&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;We reserve the right to disclose your personally identifiable information as required by law and when we believe that disclosure is necessary to protect our rights and/or comply with a judicial proceeding, court order, or legal process served on our Web site.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Transaction Security&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;All transaction details and sensitive information with Dip Tour are strictly confidential and are to be used solely for the purpose which it has been provided.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Updating Your Information&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;If you need to update any information on file so as to facilitate your request client&rsquo;s database with Dip Tour you may call or email us at info@diptourltd.com for direction or get it updated on your sign on profile with Dip Tour.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Opt-Out Provided&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Dip Tour Ltd will provide existing customers with the opportunity to &ldquo;opt-out&rdquo; or choose to be removed from future mailings ior newsletters. You may also Opt-Out by calling or sending a mail to info@diptourltd.com requesting that you be removed from certain types of future mailings. By so doing, you may still receive essential messages as it would relate directly to the particular customer&rsquo;s order or interest.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Non-Personal Information&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;On our website, Dip Tour Ltd also routinely collects statistics on site usage patterns through web logs, web beacons and third party service providers. These statistics are not intended to relate to any particular individual. Instead, they are used internally to judge the effectiveness of web site features and content. Some real-time information is occasionally used to automatically suggest a product to a customer based on that customer&rsquo;s observed preferences.&lt;/p&gt;\r\n&lt;p&gt;If you require any clarification about the privacy of your information, please contact Dip Tour Ltd Last Updated on: 10/08/12&lt;/p&gt;\r\n&lt;p&gt;If we decide to change our privacy policy, we will post those changes to this privacy statement and other places we deem appropriate so that you are aware as we may suggest that you review it frequently.&lt;/p&gt;\r\n');
