INSERT INTO `services` (`id`, `services`) VALUES
(1,	' &#x3C;p&#x3E;&#x3C;strong&#x3E;CORE activities: &#x3C;/strong&#x3E;&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;Tours I Flights I Hotel &#x26;amp; Accommodation I Ground Transportation&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;We believe in transparency in our work and dedication to your request as centred on &#x3C;strong&#x3E;Tours, Flights, Hotel &#x26;amp; Accommodation and Ground Transportation.&#x3C;/strong&#x3E;&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;&#x3C;strong&#x3E; &#x3C;/strong&#x3E;&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;&#x3C;strong&#x3E;Tours:&#x3C;/strong&#x3E;&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;We Package Tours &#x26;amp; Activities in 190+ Countries. These, include travel insurance, Local Tour Representatives / Tour Guides with 24/7 expert customer supports.&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;We package tours for Pilgrims to Sacred and Historical Destinations.&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;We engage delegates to attend international events such as Meetings, Incentives, Conference, Exhibitions (MICE); Free Independent Travelers (FIT); Group Inclusive Tour (GIT) amongst others.&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;We coordinate Sport Tourism supporting you as an observer, host or participant.&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;We get involved as Medical Tourism Facilitators, to bring together a prospective patient with a health care delivery service provider, usually a hospital or a clinic. As though the patient is crossing international borders to obtain medical care, such individual would usually be regarded as a Medical Tourist.&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;&#x3C;strong&#x3E; &#x3C;/strong&#x3E;&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;&#x3C;strong&#x3E;Flights:&#x3C;/strong&#x3E;&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;We reserve and book Local &#x26;amp; International Flights as well as providing Airport Protocol Services.&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;&#x3C;strong&#x3E; &#x3C;/strong&#x3E;&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;&#x3C;strong&#x3E;Hospitality: &#x3C;/strong&#x3E;&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;We are committed to the Entertainment of guest and their host and also Reserve 600,000+ Hotels, Apartments, Villas, Accommodation &#x26;amp; more at your preferred location/destination.&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;&#x26;nbsp;&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;&#x3C;strong&#x3E;Ground Transport: &#x3C;/strong&#x3E;&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;We lease cars locally &#x26;amp; globally with features such as, Chauffeur Driven Cars, Security Escorts &#x26;amp; Tracking, Automobile Insurance and Road Network advisory.&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;&#x3C;em&#x3E; &#x3C;/em&#x3E;&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;&#x3C;em&#x3E;We work on your plans with the same dedication as you. Sometimes, we involve your staff and let them create a sense of ownership of what is being enrolled.&#x3C;/em&#x3E;&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;From &#x3C;strong&#x3E;Strategic, Tactical and Operational&#x3C;/strong&#x3E; level without doubt and no stress, we offer a wide array of services in the tourism sector.&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;The solutions we provide support individuals, &#x26;amp; groups; institutions and corporate organizations on the basis of what their aspirations could be as evolving from their goals, lifestyle and business culture.&#x3C;/p&#x3E;\r\n&#x3C;p&#x3E;In addition, we get engaged with projects to retain, and promote Tourism.&#x3C;/p&#x3E;');
